# Main Application
class BrokerApp:
    def __init__(self):
        self.error_handler = ErrorHandler()
        self.file_handler: Optional[FileHandler] = None
        self.data_cache = DataCache()
        self.submission_manager = SubmissionManager()
        self.agency_data: Dict[str, AgencyData] = {}
        self.data_processor = DataProcessor()
        self.ui_manager = UIManager()

    def initialize_validation_rules(self):
        rule1 = ValidationRule("DB-2213", "Updated validation rule for Broker")
        self.error_handler.add_rule(rule1)

    def process_submission(self, file_path: str, agency_id: str):
        self.file_handler = FileHandler(file_path)
        if not self.file_handler.validate_file_extension([".csv", ".json"]):
            raise ValueError("Invalid file extension")

        data = self.file_handler.read_file()
        errors = self.error_handler.validate(data)
        if errors:
            raise ValueError(f"Validation errors: {errors}")

        submission_id = f"sub_{datetime.datetime.now().timestamp()}"
        submission = Submission(submission_id, "processed")
        self.submission_manager.add_submission(submission)

        agency_data = AgencyData(agency_id)
        for record in data:
            processed_record = self.data_processor.derive_funding_agency_code(record)
            agency_data.add_data(processed_record)

        self.agency_data[agency_id] = agency_data
        self.data_cache.set(submission_id, data)

    def update_ui_page(self, page_name: str, new_version: int):
        page = UIPage(page_name, new_version)
        self.ui_manager.add_page(page)
        page.update_design(new_version)

# Example usage
